import React from 'react'

const Suggestions = (props) => {
  const options = props.results.map(r => (
    <button style={{display:'block'}} type='submit' key={r.id}>
      {`${r.first_name} ${r.last_name}`}
    </button>
  ))
  return <form style={{display:'block', minWidth: '230px',
  border: '1px solid #ddd;'}} onSubmit={props.submit}>{options}</form>
}

export default Suggestions
